import React from 'react'
import {TodoItem} from "./TodoItem"

export default function TodoList({todos}) {
  return (
    <div>{
            todos.map((todo,i)=>(
                <TodoItem key={`todo-${i}`}todo={todo}/>
            ))}
            </div>
  )
}
